    data: |
      SELECT DISTINCT - 36 AS col1, col2 / ( 74 ) + - col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q10952.out
    data: |
      -36	-46
      -36	-64
      -36	-75
